import React from "react";
import { Pagination as Paginate } from "antd";

const Pagination = props => {
  const pageNumbers = [];

  return (
    <div>
      <Paginate
        total={props.total}
        showTotal={(total, range) =>
          `${range[0]}-${range[1]} of ${total} items`
        }
        pageSize={20}
        defaultCurrent={1}
      />
    </div>
  );
};

export default Pagination;
